  const [userLocation, setUserLocation] = useState(null)
  const [weatherData, setWeatherData] = useState({})

  const isWeatherDataEmpty = Object.keys(weatherData).length === 0;
return <div>
  {isWeatherDataEmpty ? <div  className="flex justify-around">
(<Weather userLocation={userLocation} setUserLocation={setUserLocation} />
<Calendar/>
<SendData userLocation={userLocation} setWeatherData={setWeatherData} />  </div>
 :
<ShowWeather/>
}
</div>

}
